import React from "react";
import Navbar from "./Navbar";
import Table, { AvatarCell, SelectColumnFilter, StatusPill } from "./Table"; // new

const getData = () => {
  const data = [
    {
      name: "Moh Alfaiz Ali",
      position: "Software Trainee",
      company: "Tata Consultancy Services",
      department: "Engineering",
      batch: 2023,
      branch: "CS/IT",
      ctc: 3.2,
      imgUrl:
        "https://pbs.twimg.com/profile_images/1534900086727409667/oYWJND3A_400x400.jpg",
      socials: "LinkedIn",
      profileUrl: "https://www.linkedin.com/in/imalfaiz/",
    },
  ];
  return [...data];
};

function App() {
  const columns = React.useMemo(
    () => [
      {
        Header: "Name",
        accessor: "name",
        Cell: AvatarCell,
        imgAccessor: "imgUrl",
        positionAccessor: "position",
      },
      {
        Header: "Company",
        accessor: "company",
      },
      {
        Header: "Batch",
        accessor: "batch",
        // Cell: StatusPill,
      },
      {
        Header: "CTC (in LPA)",
        accessor: "ctc",
      },
      {
        Header: "Branch",
        accessor: "branch",
        Filter: SelectColumnFilter, // new
        filter: "includes",
      },
      {
        Header: "Socials",
        accessor: "soc",
      }
    ],
    []
  );

  const data = React.useMemo(() => getData(), []);

  return (
    <div className="min-h-screen bg-gray-100 text-gray-900">
      <main className="max-w-5xl mx-auto px-4 sm:px-6 lg:px-8 pt-4">
        <div className="">
          <Navbar />
        </div>
        <div className="mt-6">
          <Table columns={columns} data={data} />
        </div>
      </main>
    </div>
  );
}

export default App;
